import Navbar from './Navbar.js';
import About from './About.js';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
    return (
        <Router>
            <div className="App"> 

                <Navbar/>

                <div className='content'>
                    <Routes>
                        <Route path='/' element={<About/>}></Route>
                    </Routes>
                </div>

            </div>
        </Router>
    );
}

export default App;
